import React from "react";
import './App.css';
import useFetch from './useFetch';


function App() {

  const {data, loading, error} = useFetch("https://api.coingecko.com/api/v3/coins/alkimi");

  if (loading) return <h1>LOADING...</h1>

  if (error) console.log(error);


  return (
    <div className="App">
      <span>ID:</span><p>{data?.id}</p>
      <span>Symbol: </span><p>{data?.symbol}</p>
      <span>Name: </span><p>{data?.name}</p> 
      <span>Asset platform ID: </span><p>{data?.asset_platform_id}</p> 
      <span></span><p>Homepage: {data?.links.homepage}</p> 
      <span></span><p>announcment URL {data?.announcement_url}</p> 
      <span></span><p>Twitter: {data?.twitter_screen_name}</p> 
      <span></span><p>Telegram: {data?.telegram_channel_identifier}</p> 
      <span></span><p>Contact Address: {data?.contract_address}</p> 
      <span></span><p>Current Price: Â£{data?.market_data.current_price.gbp}</p> 
    </div>

  );
}

export default App;
